import { createStore } from 'redux';
import { addObj } from "./actions";

export function reducer(state = [], action:any):any{
    if(action.type === 'addObj'){
      return[
        ...state,
        action.obj
      ]
    }
    console.log(action)
    return state
}


const store = createStore(reducer);

store.subscribe(()=>{
  console.log(store.getState())
})

store.dispatch({type: 'addObj', obj: {email:'some@gmail.com'}})
store.dispatch({type: 'addObj', obj: {email:'second@gmail.com'}})
export default reducer
